<style>

.states {
  fill: #47cc91;
}

.state-borders {
  fill: none;
  stroke: #fff;
  stroke-width: 1.5px;
  stroke-linejoin: round;
  stroke-linecap: round;
}

.airport-arcs {
  display: none;
  fill: none;
  stroke: #4679de;
}

.airport-cell {
  fill: none;
  pointer-events: all;
}

.airports circle {
  fill: steelblue;
  stroke: #fff;
  pointer-events: none;
}

.airport:hover .airport-arcs {
  display: inline;
}

	var airportById = d3.map(),
		positions = [];

	airports.forEach(function(d) {
		airportById.set(d.iata, d);
		d.outgoing = [];
		d.incoming = [];
	});

	flights.forEach(function(flight) {
		var source = airportById.get(flight.origin),
			target = airportById.get(flight.destination),
			link = {source: source, target: target};
		source.outgoing.push(link);
		target.incoming.push(link);
	});

	airports = airports.filter(function(d) {
		if (d.count = Math.max(d.incoming.length, d.outgoing.length)) {
		  d[0] = +d.longitude;
		  d[1] = +d.latitude;
		  var position = projection(d);
		  d.x = position[0];
		  d.y = position[1];
		  return true;
		}
	});

	voronoi(airports)
		.forEach(function(d) { d.point.cell = d; });

	svg.append("path")
		.datum(topojson.feature(us, us.objects.land))
		.attr("class", "states")
		.attr("d", path);

	svg.append("path")
		.datum(topojson.mesh(us, us.objects.states, function(a, b) { return a !== b; }))
		.attr("class", "state-borders")
		.attr("d", path);

	var airport = svg.append("g")
			.attr("class", "airports")
			.selectAll("g")
			.data(airports.sort(function(a, b) { return b.count - a.count; }))
			.enter().append("g")
			.attr("class", "airport");

	airport.append("path")
		.attr("class", "airport-cell")
		.attr("d", function(d) { return d.cell.length ? "M" + d.cell.join("L") + "Z" : null; })
		.on("mouseover", function (d, i) {
			 tooltip.style('opacity', '1').style('display', 'inline');
			drawTooltip(d);
		})
		//.on('mousemove', drawTooltip)
		.on('mouseout', removeTooltip);

	airport.append("g")
		.attr("class", "airport-arcs")
		.selectAll("path")
		.data(function(d) { return d.outgoing; })
		.enter().append("path")
		.attr("d", function(d) { return path({type: "LineString", coordinates: [d.source, d.target]}); });

	airport.append("circle")
		.attr("transform", function(d) { return "translate(" + d.x + "," + d.y + ")"; })
		.attr("r", function(d, i) {console.log(d); return Math.sqrt(d.count); });
	function removeTooltip() {
	  if (tooltip){ 
		tooltip.style('display', 'none')
	  };
	}

	function drawTooltip(d) {
		tooltip.style('opacity', '1').style('display', 'inline');
		tooltip.html('<strong>City : </strong>'+d.city+"</br>"+
						'<strong>Flights : </strong>'+d.count)
				.style('left', (d3.event.pageX + 30) + 'px')
				.style('top', (d3.event.pageY - 52) + 'px');
	  
	}
